//SPDX-License-Identifier: MIT

pragma solidity ^0.8.7;

contract Todo {

    event TaskCreated(
        address indexed owner,
        string indexed text
    );

    event TaskCompleted(
        address indexed owner
    );

    event TaskUpdated(
        address indexed owner,
        string oldText,
        string newText
    );

    struct Task {
        string text;
        bool completed;
    }

    mapping(address => Task[]) public tasks;

    function createTask(string calldata _text) external {
        tasks[msg.sender].push(Task({
            text: _text,
            completed: false
        }));

        emit TaskCreated(
            msg.sender, 
            _text
        );
    }

    function getTask(uint _index) external view returns (string memory, bool) {
        Task memory task = tasks[msg.sender][_index];
        return (task.text, task.completed);
    }

    function updateTask(uint _index, string memory _text) external {
        string memory oldText = tasks[msg.sender][_index].text;
        tasks[msg.sender][_index].text = _text;

        emit TaskUpdated(
            msg.sender, 
            oldText, 
            _text
        );
    }

    function toggleCompleted(uint _index) external {
        tasks[msg.sender][_index].completed = !tasks[msg.sender][_index].completed;

        emit TaskCompleted(
            msg.sender
        );
    }

}
